import styled from 'styled-components'

export const Container = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    width: 2rem;
    height: 2rem;
`

export const Bar = styled.div`
    display: block;
    height: 2px;
    width: 100%;
    background-color: #000000; 

`
